urce":["> Question : How much probability other peoples will ordered Wired Headphones?\n","> \n","> Answer : The probability that next people will order Wired Headphones is 10.15%"]},{"cell_type":"markdown","id":"29b42591","metadata":{"papermill":{"duration":0.040927,"end_time":"2023-04-30T15:39:03.271376","exception":false,"start_time":"2023-04-30T15:39:03.230449","status":"completed"},"tags":[]},"source":["**Conclusion**\n","\n","- The city that has the most total quantity sales are San Francisco (50,239), Los Angeles (33,289) and New York City (27,932)\n","\n","- To maximize the company's advertising efforts, it is recommended to advertise in December, October, and April, as the company generated the most orders during these months (4,613,443 USD, 3,736,726 USD, and 3,390,670 USD, respectively).\n","\n","- Tuesdays were found to be the most profitable day for advertising, generating 5,087,957 USD, while Thursdays had the lowest number of sales(4,839,465 USD).\n","\n","- The best times for advertising were between 9:00-12:00 and 16:00-19:00,when the company typically had the highest sales.\n","\n","- Top 5 Best selling product are USB-C Charging Cable, Lightning Charging Cable, AAA Batteries (4-pack), AA Batteries (4-pack) and Wired Headphones.\n","\n","- Products that are often sold together are iPhone and Lightning Charging Cable which sold 1,764 orders, and Google Phone, USB-C Charging Cable ranked second with 1,712 orders, and the third most are iPhone and Wired Headphones 722 orders.\n","\n","- The probability of customers ordering specific products compared to all other products was calculated as following: \n","       * USB-C Charging Cable: 11.77% \n","       * iPhone: 3.67% \n","       * Google Phone: 2.97% \n","       * Wired Headphones: 10.15%"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":31.844624,"end_time":"2023-04-30T15:39:03.437412","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-04-30T15:38:31.592788","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}